INSERT INTO `crm_contact_record` VALUES ('116', '40C3A36B-7E5F-4883-A1E9-A33E54113620', null, '4E6B3FAB-3B23-4AC1-85AE-FB5F48372427', '9856DCA5-25EA-4FB8-ADF8-28F0F68A9ADF', '<p style=\"margin-top: 16px; margin-bottom: 16px; padding: 0px; -webkit-font-smoothing: subpixel-antialiased; text-indent: 2em; color: rgb(41, 41, 41); font-family: &quot;Microsoft YaHei&quot;, SimSun, SimHei, &quot;STHeiti Light&quot;, STHeiti, &quot;Lucida Grande&quot;, Tahoma, Arial, Helvetica, sans-serif; font-size: 16px; line-height: 2;\">2019年2月27日、3月3日，北京大学2018年基层党委书记述职评议考核会议分两场在勺园7号楼弘雅厅举行。邱水平、郝平、于鸿君、安钰峰、叶静漪、王仰麟、王博、龚旗煌、陈宝剑、柴真、蒋朗朗等校党政领导班子成员，校本部全部基层单位党委书记、行政负责人、党委副书记出席了会议。参加会议的还有学校职能部门负责人代表、民主党派代表、教代会代表、学代会代表、离退休人员代表、党支部书记代表。会议由校党委书记邱水平主持。</p><p style=\"margin-top: 16px; margin-bottom: 16px; padding: 0px; -webkit-font-smoothing: subpixel-antialiased; color: rgb(41, 41, 41); font-family: &quot;Microsoft YaHei&quot;, SimSun, SimHei, &quot;STHeiti Light&quot;, STHeiti, &quot;Lucida Grande&quot;, Tahoma, Arial, Helvetica, sans-serif; font-size: 16px; line-height: 2;\"><img src=\"http://news.pku.edu.cn/images/2019-03/b38d1ee3a642458d908c2351d1fa0343.jpeg\" width=\"424\" height=\"238\" style=\"margin: 0px auto; padding: 5px 0px; -webkit-font-smoothing: subpixel-antialiased; border-style: none; width: 550px; max-width: 100%; height: auto; text-align: center; display: block;\"></p>', 'AE6A00E0-BC66-4269-AD2E-D85DD04ABED3,', '0', '2019-03-22', '0', 'admin', '2019-03-01 13:31:31', 'on', '8EADB678-A646-1E51-3E87-75A547B8AF19');
