INSERT INTO `dynamic` VALUES ('14', '64227931-F2A7-4AC5-B470-616C092173DE', 'jinzhong', 'D0FA5FF8-74B3-48A2-8D60-9D65AF64337A:7B71D748-25E8-4984-AAF3-7B4DB980CB4D:0D2ED244-3301-4B77-88A6-D2B790F33796:848848D7-A831-455E-9A47-A2BF8F138A35', '常州爱普超高压液压系统有 [1]  限公司是国内较早致力于超高压液压产品研发、制造和服务的高科技企业,凭借二十多年来在该产业的经验,爱普公司已经证明了解决最需应用问题的能力。多年来的研究和发展,使得该企业在超高液压技术方面提供了大量安全、可信得产品。\r\n公司主要产品是螺栓液压拉伸器、液压螺母、液压扳手、千斤顶、手动液压泵、电动液压泵和气动液压泵等。典型得应用领域是螺栓紧固与拆卸、液压起重、联轴器拆装、压力试验等，主要应用在造船、石油化工、电力、冶金、桥梁、铁路和重型机械等工业。', '2019-07-01 09-22:13', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `dynamic` VALUES ('16', '08FB0EB3-24E0-4BEA-B33C-4F839DF65BBD', 'jinzhong', '6BAB6FC2-D9CA-4756-99AC-5705B36A3807:F3F2A4EA-6ED9-47BC-B23F-57EBDD446FAB:2FF000E4-47EF-44B1-878E-9D2DEA6BA211', '作为提供螺栓紧固与拆卸解决方案的专业公司，该公司竭诚为客户提供个性化的解决方案。完善的技术支持、品质卓越的产品和细致周到的服务是公司业务日益增长的根本。快速、经济、安全、精确，客户满意是公司的目标，爱普是您在螺栓紧固与拆卸方案上的最佳提供者。\r\n该公司通过推行ISO9001：2000质量体系，建立了健全全公司的质量管理体系和质量保证体系，是我们为客户提供高品质产品和高效服务的有力保障。', '2019-07-01 09-47:52', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `dynamic` VALUES ('17', '26023B29-8818-4A9A-92BB-60031270A47A', 'admin', '9FDB1D6B-D8B6-4791-BC8D-BE54B41110E0:37173206-A9CA-4CE6-965F-A0EEE321384F', '在市场越来越激烈的竞争中，最关键的是质量和服务的竞争，而不是价格的竞争。在众多的服务商提供的产品中，你可能首选价格，但你一定更关心质量和服务。其实缺乏了质量和售后服务的保证，价格再低我们倡导：价格竞争以质量和售后服务为前提，质量竞争第一。', '2019-07-01 10-41:32', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `dynamic` VALUES ('18', '9E13A336-FE08-42C6-ABB0-29CE31599749', 'jinzhong', 'E3F3C05D-8523-49D5-9DE1-7C9F63491E48:01BF9A92-60B1-4ACF-BE3B-56E66375711D:AACC4DD1-12B5-40E8-B76F-BE7162776A8F:BDBF49A3-327B-44F3-94BE-85F6C4BDEF44', '四、企业理念\r\n经营理念：诚信 高效 稳健 共赢\r\n用人原则：德才兼备 以德为先\r\n行为准则：按照说的做 按照做的说\r\n价格理念：价格上我们没有太多优势，品质和服务上我们可以给你更多保证\r\n营销理念：产品可以因价格失去一次机会，产品不能因质量永远失去机会', '2019-07-01 10-48:07', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `dynamic` VALUES ('19', 'A4D3D005-FEB5-4A06-A899-FB276D543B38', 'jinzhong', '131DAC10-88F3-47AC-9674-3609589BD32F:D9439A55-7748-4569-9EE4-A16884852C77:1B068EFF-E546-47C4-B09A-FA6AB3F5B12C', '国家统计局1日发布《沧桑巨变七十载民族复兴铸辉煌——新中国成立70周年经济社会发展成就系列报告之一》。报告显示，新中国成立70周年以来，我国国民经济持续快速增长，经济总量连上新台阶。2018年我国人均国民总收入达到9732美元，高于中等收入国家平均水平。\n新中国诞生时，我国经济基础极为薄弱。1952年我国国内生产总值仅为679亿元，人均国内生产总值为119元。经过长期努力，1978年我国国内生产总值增加到3679亿元，占世界经济的比重为1.8%，居全球第11位。', '2019-07-02 15-10:51', '8EADB678-A646-1E51-3E87-75A547B8AF19');
