INSERT INTO `email_body` VALUES ('7', 'A7E43053-ECCA-4E74-B25B-06F5606EDCFF', 'admin', 'liushaoquan', null, '治愈后的夫妻俩主动当起志愿者 用“爱的回报”温暖更多人', '新系统上线可能存在权限与设置问题。若发现问题请与系统管理联系', '<p style=\"margin-top: 1.5em; margin-bottom: 1.5em; border: 0px; font-size: 18px; line-height: 2; color: rgb(0, 0, 0); word-break: break-all; font-family: 微软雅黑, SimSun, Arial, Helvetica, sans-serif; text-align: justify; padding: 0px 0px 1.5em !important;\">湖北日报全媒记者 成熔兴 通讯员 宋亮 周婧雯</p><p style=\"margin-top: 1.5em; margin-bottom: 1.5em; border: 0px; font-size: 18px; line-height: 2; color: rgb(0, 0, 0); word-break: break-all; font-family: 微软雅黑, SimSun, Arial, Helvetica, sans-serif; text-align: justify; padding: 0px 0px 1.5em !important;\">“在最困难的时候，是社区干部、家里月嫂帮了我们，是医院医生救了我们。我们一定要回报他们、回报社会！”</p><p style=\"margin-top: 1.5em; margin-bottom: 1.5em; border: 0px; font-size: 18px; line-height: 2; color: rgb(0, 0, 0); word-break: break-all; font-family: 微软雅黑, SimSun, Arial, Helvetica, sans-serif; text-align: justify; padding: 0px 0px 1.5em !important;\">3月25日，家住武汉市东西湖区将军路街保利公园小区的翁江，向湖北日报全媒记者讲述了自己一家患病、医治、受助、再助人的心路历程——</p><p style=\"margin-top: 1.5em; margin-bottom: 1.5em; border: 0px; font-size: 18px; line-height: 2; color: rgb(0, 0, 0); word-break: break-all; font-family: 微软雅黑, SimSun, Arial, Helvetica, sans-serif; text-align: justify; padding: 0px 0px 1.5em !important;\">艰难时刻伸出的援手，就像一束光</p><p style=\"margin-top: 1.5em; margin-bottom: 1.5em; border: 0px; font-size: 18px; line-height: 2; color: rgb(0, 0, 0); word-break: break-all; font-family: 微软雅黑, SimSun, Arial, Helvetica, sans-serif; text-align: justify; padding: 0px 0px 1.5em !important;\">我今年40岁，是武汉市燃气热力集团员工，中共党员。现在回头去看，如果那时候不是染病，我肯定也会像其他党员、同事一样，一开始就冲在最前线。</p>', '2020-04-04 23:02:35', '', '1', null, null, null, null, '0', 'ddSms', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `email_body` VALUES ('8', '0458BCAD-6EDE-40FE-B612-EBD54D91543E', 'admin', 'liushaoquan', null, '约翰斯·霍普金斯大学：全球新冠死亡病例超六万', '新系统上线可能存在权限与设置问题。若发现问题请与系统管理联系', '<p style=\"margin-top: 10px; margin-bottom: 20px; padding: 0px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">新华社纽约4月4日电 美国约翰斯·霍普金斯大学最新发布的数据显示，截至美国东部时间4日上午8时（北京时间4日20时），全球新冠死亡病例超过6万例，达到60115例。</p><p style=\"margin-top: 10px; margin-bottom: 20px; padding: 0px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">数据显示，目前死亡病例最多的国家为意大利，达14681例。此外，西班牙死亡病例达11744例，法国死亡病例达6507例。全球新冠累计确诊病例已达1134418例。其中美国最多，为278458例；接下来是西班牙和意大利，确诊病例分别为124736例和119827例。</p>', '2020-04-04 23:11:29', '', '1', null, null, null, null, '0', 'ddSms', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `email_body` VALUES ('9', '00E0E5F0-26C1-4979-93E6-BC0D546521F3', 'admin', 'liushaoquan', null, '约翰斯·霍普金斯大学：全球新冠死亡病例超六万', '新系统上线可能存在权限与设置问题。若发现问题请与系统管理联系', '<p style=\"margin-top: 10px; margin-bottom: 20px; padding: 0px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">新华社纽约4月4日电 美国约翰斯·霍普金斯大学最新发布的数据显示，截至美国东部时间4日上午8时（北京时间4日20时），全球新冠死亡病例超过6万例，达到60115例。</p><p style=\"margin-top: 10px; margin-bottom: 20px; padding: 0px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">数据显示，目前死亡病例最多的国家为意大利，达14681例。此外，西班牙死亡病例达11744例，法国死亡病例达6507例。全球新冠累计确诊病例已达1134418例。其中美国最多，为278458例；接下来是西班牙和意大利，确诊病例分别为124736例和119827例。</p>', '2020-04-04 23:14:51', '', '1', null, null, null, null, '0', 'ddSms', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `email_body` VALUES ('10', 'F6450C56-2098-4790-A2A4-2915B471D63D', 'admin', 'admin', null, '贴近百姓生活 深入田间地头', '炎炎夏日，夜色渐浓。村民们手摇蒲扇，陆陆续续来到新时代文明实践站，江西省寻乌县澄江镇周田村的“屋场夜...', '<p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">炎炎夏日，夜色渐浓。村民们手摇蒲扇，陆陆续续来到新时代文明实践站，江西省寻乌县澄江镇周田村的“屋场夜话”开场了。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　“嘿哟嗬……寻乌河水波连波，一法一规总关情，百科全书《民法典》，生老病死它都管……”65岁的王焕平一亮嗓，歌词晓畅，曲调悠扬，引来现场村民一片叫好。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　王焕平是土生土长的周田村人，也是寻乌县培养的“百姓名嘴”之一。为更好地宣传党的创新理论，寻乌县新时代文明实践中心从驻村工作队长、脱贫示范户、有文艺特长的群众中，选拔出一批“百姓名嘴”，结合乡土文化、村民理论接受能力等实际情况，用乡音乡语传递党的声音、回应群众关切。依托“百姓名嘴”工程，王焕平已创作出300多首寻乌山歌，还有了自己的工作室。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　近年来，各地新时代文明实践中心深入宣传习近平新时代中国特色社会主义思想，宣讲党的政策，培育主流价值，活跃文化生活，注重贴近农民思想和生产生活实际，让身边人说身边事、用百姓话说百姓事，丰富传播手段、创新话语表达、提升百姓志愿参与文明实践的积极性，让党的创新理论更好深入基层、落地生根，飞入寻常百姓家。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　手段更加丰富</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　——“形式新颖，内容丰富，大伙都爱听”</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　“写字要写田字格，人人都要讲道德；社会公德要遵守，不搞赌博不去偷……”最近，贵州省龙里县湾滩河镇各个村寨分外热闹。一支支“山歌伴飞新思想”志愿服务队走村串寨，将党的创新理论、社会主义核心价值观等编成山歌，巡回传唱。</p>', '2020-07-06 16:27:52', '', '1', null, null, null, null, '0', 'webSms,ddSms,wxSms', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `email_body` VALUES ('11', '4AD2071E-C18A-48E7-8646-35B4B3AEBE01', 'admin', 'admin', null, '贴近百姓生活 深入田间地头', '炎炎夏日，夜色渐浓。村民们手摇蒲扇，陆陆续续来到新时代文明实践站，江西省寻乌县澄江镇周田村的“屋场夜...', '<p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">炎炎夏日，夜色渐浓。村民们手摇蒲扇，陆陆续续来到新时代文明实践站，江西省寻乌县澄江镇周田村的“屋场夜话”开场了。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　“嘿哟嗬……寻乌河水波连波，一法一规总关情，百科全书《民法典》，生老病死它都管……”65岁的王焕平一亮嗓，歌词晓畅，曲调悠扬，引来现场村民一片叫好。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　王焕平是土生土长的周田村人，也是寻乌县培养的“百姓名嘴”之一。为更好地宣传党的创新理论，寻乌县新时代文明实践中心从驻村工作队长、脱贫示范户、有文艺特长的群众中，选拔出一批“百姓名嘴”，结合乡土文化、村民理论接受能力等实际情况，用乡音乡语传递党的声音、回应群众关切。依托“百姓名嘴”工程，王焕平已创作出300多首寻乌山歌，还有了自己的工作室。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　近年来，各地新时代文明实践中心深入宣传习近平新时代中国特色社会主义思想，宣讲党的政策，培育主流价值，活跃文化生活，注重贴近农民思想和生产生活实际，让身边人说身边事、用百姓话说百姓事，丰富传播手段、创新话语表达、提升百姓志愿参与文明实践的积极性，让党的创新理论更好深入基层、落地生根，飞入寻常百姓家。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　手段更加丰富</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　——“形式新颖，内容丰富，大伙都爱听”</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　“写字要写田字格，人人都要讲道德；社会公德要遵守，不搞赌博不去偷……”最近，贵州省龙里县湾滩河镇各个村寨分外热闹。一支支“山歌伴飞新思想”志愿服务队走村串寨，将党的创新理论、社会主义核心价值观等编成山歌，巡回传唱。</p>', '2020-07-06 16:29:45', '', '1', null, null, null, null, '0', 'wxSms', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `email_body` VALUES ('12', 'D61E159B-57D3-44B8-93E5-A53154F5939A', 'admin', 'admin', null, '雪中送炭体现特殊友谊（大使随笔）', '济是西南太平洋上的岛国，也是第一个同新中国建交的太平洋岛国。建交45年来，两国始终守望相助，命运与共...', '<p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">济是西南太平洋上的岛国，也是第一个同新中国建交的太平洋岛国。建交45年来，两国始终守望相助，命运与共，结下深厚友谊。中斐关系已成为中国同太平洋岛国关系的典范。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　在中国人民抗击新冠肺炎疫情的艰难时刻，斐济政府和人民给予了坚定声援和支持。斐济总理姆拜尼马拉马表示：“坚信中国政府有能力采取迅速有力措施防控疫情，斐济将坚定同中国站在一起，共克时艰。”斐济时任外长塞鲁伊拉图表示：“中国为抗击疫情付出了巨大努力和牺牲，应该受到各国尊敬和赞誉。”斐济民众纷纷向中国驻斐济大使馆发来视频，高喊“中国加油”“武汉加油”；许多网民在社交网络上表达暖心祝福；斐济媒体赞扬中国政府抗击疫情成效和开展抗疫国际合作。在武汉的斐济留学生主动向外界展示中国抗疫成效，呼吁西方媒体不要造谣传谣，并“为能见证中国人民伟大的抗疫斗争而感到骄傲”。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　新冠肺炎疫情给斐济带来巨大公共卫生压力。危难面前，中国第一时间伸出援手，与斐济共同打响抗疫“协同战”。从中央到地方政府，从中资企业到民间团体，中方陆续向斐济捐助抗疫物资。两国卫生专家及时召开视频会议，深入交流防控经验，分享研究数据、共享诊疗方案。不久前，中国同斐济等太平洋岛国举行应对新冠肺炎疫情副外长级特别会议，各方就加强应对疫情协调配合，反对将疫情政治化、污名化、标签化，支持世界卫生组织在协调推进全球抗疫合作中的领导作用等达成广泛共识。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　斐济时任外长塞鲁伊拉图代表斐济政府和人民对中方支持和援助深表感谢，认为“这是雪中送炭，体现了两国特殊友好关系”。斐济卫生部长瓦卡伊纳贝特表示：“中方在自身面临困难的情况下，慷慨向斐济提供医疗物资援助，充分体现了中国人民对斐济人民的深厚情谊。中国短时间有效控制住疫情，为世界树立了榜样。”斐济应对新冠肺炎疫情工作组负责人詹姆斯·冯称赞，“中国成功控制疫情增强了我们的信心。”当下最重要的是各国携手抗疫，重要办法就是借鉴中国经验。斐济和其他太平洋岛国政要也纷纷赞扬中国本着公开、透明和负责任态度，及时采取有力防疫措施，分享抗疫经验，认为这充分体现了中国的大国担当和人类命运共同体理念。</p><p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin-bottom: 25px; font-size: 18px; text-align: justify; word-break: normal; overflow-wrap: break-word; color: rgb(47, 47, 47); font-family: PingFangSC-Regular, STXihei, Verdana, Calibri, Helvetica, Arial, sans-serif;\">　　令人欣慰的是，在疫情面前，中斐友好交往合作没有停摆。在全力抗疫的日子里，我亲眼见证两国多个合作项目成功交接。姆拜尼马拉马总理对我说：“尽管世界因疫情陷入困境，但斐中两国人民的美好情谊仍跨越国界传达给彼此。”我深切感受到，疫情虽然给中</p>', '2020-07-06 16:38:11', '', '1', null, null, null, null, '0', 'wxSms', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `email_body` VALUES ('13', 'EE87492B-DA33-4E5F-9A46-9B98C4752ABA', 'admin', 'admin', null, '时隔60年专家揭秘“北京九所”：这里的大事曾经“跟任何人都不能说”', '六十年前，中国处在三年困难时期，同时面临着西方大国的核讹诈与核垄断。一批科学家下定决心，为了祖国核事...', '<p style=\"margin-top: 10px; margin-bottom: 20px; padding: 0px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">六十年前，中国处在三年困难时期，同时面临着西方大国的核讹诈与核垄断。一批科学家下定决心，为了祖国核事业“干惊天动地事，做隐姓埋名人！”</p><p style=\"margin-top: 10px; margin-bottom: 20px; padding: 0px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">胡思得、李德元和李维新是原二机部第九研究所三位参与核武器研制的科学家，如今都已到了耄耋之年，但加入这项事业时，他们都还是刚刚大学毕业的年轻人。近日，三位科学家接受总台央视记者专访，一起回忆中国核武器探索的峥嵘岁月。</p><p style=\"margin-top: 10px; margin-bottom: 20px; padding: 0px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\"><strong>“核武器”三个字后面是“跟任何人都不能说”的隐秘</strong></p><p style=\"margin-top: 10px; margin-bottom: 20px; padding: 0px; list-style: none; line-height: 30px; font-size: 16px; word-break: break-all; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Helvetica, &quot;Microsoft YaHei&quot;, simsun, sans-serif; background-color: rgb(249, 249, 249);\">1958年7月，北京西郊的一片高粱地里，一座名为“花园路3号院”的办公楼开始动工，“北京九所”就是在这里。</p>', '2020-07-06 16:41:40', '', '1', null, null, null, null, '0', 'wxSms', '8EADB678-A646-1E51-3E87-75A547B8AF19');
