INSERT INTO `inquiry` VALUES ('15', '65cfd4f7-eeb7-4a5f-b3a5-e2a57d3410be', '询价单测试', '国家统计局1日发布《沧桑巨变七十载民族复兴铸辉煌——新中国成立70周年经济社会发展成就系列报告之一》。报告显示，新中国成立70周年以来，我国国民经济持续快速增长，经济总量连上新台阶。2018年我国人均国民总收入达到9732美元，高于中等收入国家平均水平。\n新中国诞生时，我国经济基础极为薄弱。1952年我国国内生产总值仅为679亿元，人均国内生产总值为119元。经过长期努力，1978年我国国内生产总值增加到3679亿元，占世界经济的比重为1.8%，居全球第11位。', 'A1DAB166-9A9A-43BC-82DC-A92238CBFBE5:C4096736-82B3-4072-87E0-8497ECEBFC28:90F5B1A5-E5D0-4FB6-AE6A-8C74143DA3DE:9DB592BC-F75E-418B-9CF4-EF31CCBFD278', '2019-08-01', '定向询价', '2019-07-02 14-14:13', 'admin', null, 'xxxx住房保障中心', '8EADB678-A646-1E51-3E87-75A547B8AF19');
