INSERT INTO `project_build_details` VALUES ('3', '217023D0-DF82-45CB-B535-E60A36B3C3C4', '1C0BBD06-492A-4CD7-9044-767CCA533FE2', '1', null, '安徽合肥国家工业园办楼整体翻新', '1', '<p style=\"margin-bottom: 0px; padding: 0px; font-size: 16px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial;\"><span class=\"bjh-p\">近日，国家监委与联合国签署反腐败合作谅解备忘录，这是国家监委成立后首次同联合国签署反腐败合作文件，规定双方将围绕预防和惩治腐败、资产追回、信息分享和交流、培训和能力建设、“一带一路”倡议，及促进联合国2030年可持续发展目标的落实等开展务实合作。这一文件的成功签署，体现出国际社会对我国监察体制改革和国家监委的充分理解和认可，对促进《联合国反腐败公约》实施，完善相关机制，推动双方开展国际追逃追赃、廉洁丝绸之路建设等合作具有重要意义。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; font-size: 16px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial;\"><span class=\"bjh-p\">反腐败国际合作已成为国际社会的普遍性义务，是世界各国的共同意愿。《联合国反腐败公约》是联合国历史上通过的第一个全球性反腐败法律文件，专章规定反腐败国际合作和资产返还，为各国依法开展反腐败务实合作奠定了基础。目前，公约缔约国达到186个。多年来，中国坚定支持《公约》在反腐败国际合作中发挥主渠道作用，与联合国以及多个国家，在《公约》和各自法律框架下，共建执法合作机制，共同打击跨国腐败犯罪，不断加强反腐败追逃追赃和廉洁丝绸之路建设等合作，构建更加紧密便捷的司法执法合作网络。同时，切实推进国际反腐败治理，形成了《北京反腐败宣言》《二十国集团反腐败追逃追赃高级原则》《腐败资产追缴国际合作十条倡议》，及《廉洁丝绸之路北京倡议》等一系列构建国际反腐败新秩序重要成果，努力与各方一道携手前行。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; font-size: 16px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial;\"><span class=\"bjh-p\">我国近年来在反腐败国际追逃追赃工作中的艰苦努力和实际成果，充分彰显了党中央“有逃必追、一追到底”的坚定决心，为夺取反腐败斗争压倒性胜利提供了有力支撑。我国始终坚持法治思维和法治方式，对外遵守国际惯例和他国法律，对内依法调查取证、严格依法处置，着力提升追逃追赃工作法治化、规范化、专业化水平，推动制度优势进一步转化为治理效能。我国成立国际追逃追赃工作办公室的五年多来，在党中央坚强领导下，启动“天网”行动，反腐败追逃追赃工作成功开辟新战场，取得显著成效，对外逃腐败分子形成强大震慑，也为国际社会合作打击跨国腐败尽到了重要义务。特别是党的十九大以来，随着纪检监察体制改革深入推进，追逃追赃工作进入新阶段。2014年至今，先后追回外逃人员6690人，追回赃款151亿元人民币，“百名红通人员”已到案60人。其中，2018年，追回外逃人员1335人，追回赃款35亿多元人民币。</span></p>', null, '合肥市新区管委会', '永利', '30000000', '2019-11-01', '2020-05-31', 'jinqi', '李主任', '012-25855524-9001', '012-25855524', '68311718@qq.com', '13814042966', '2019-10-22 22:56:26', 'admin', '50FBAACD-290F-4086-B900-5EC90B77118F', '0', '8EADB678-A646-1E51-3E87-75A547B8AF19');
