INSERT INTO `superversion_process` VALUES ('1', '8D77A835-4106-40A6-B43E-CDE3C38F3521', '9A4AD9FB-30D6-4CD3-97E7-03523CB085A5', '随着新冠肺炎疫情在全球蔓延，一些粮食出口国限制大米和小麦出口。联合国粮农组织称，新冠肺炎疫情在全球蔓延致使劳动力短缺和供应链中断，可能影响一些国家和地区粮食安全。\r\n\r\n　　面对国内一些对粮食短缺的担忧，相关部门负责人和权威专家接受经济日报记者采访时表示，中国粮食连年丰收，粮食库存充足，稻谷和小麦库存均能满足1年以上的消费需求。中国有信心应对有可能到来的全球性粮食危机，牢牢端稳“饭碗”，保障国家粮食安全。', 'E50F6965-3D15-4D7D-8C43-2F42EA7CE472', '20', '2020-03-09', '2020-03-10 19:46:51', 'admin', '8EADB678-A646-1E51-3E87-75A547B8AF19');
INSERT INTO `superversion_process` VALUES ('2', '31FAFA49-7E81-41E0-AAEB-E88679C9FD2B', '9A4AD9FB-30D6-4CD3-97E7-03523CB085A5', '北京时间4月8日零时起，武汉市解除离汉通道管控措施，有序恢复对外交通。这标志着中国疫情防控阶段性成效进一步巩固，也标志着湖北保卫战、武汉保卫战进入了一个新的阶段。密切关注中国抗疫进展的外国专家学者和媒体认为，这是中国抗疫的重要时刻，中国取得的显著抗疫成效为全球抗疫注入了信心。', '', '40', '2020-04-09', '2020-04-09 15:04:51', 'admin', '8EADB678-A646-1E51-3E87-75A547B8AF19');
