INSERT INTO `task` VALUES ('5', 'A24FAA52-0484-4095-B06E-116A0506A513', '城北开发区动移', '1', '@all', '@all', '@all', 'admin', '09CB3B56-7281-45D5-AB76-DF9B7C4211CC', '4', '2020-02-27', null, '', '<p style=\"margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\">　在这场没有硝烟的战“疫”中，广大医务工作者奔赴抗疫斗争第一线，成为“最美逆行者”。在疫情防控进入最为关键的时期，通信业积极履行责任和担当，中国电信、中国移动、中国联通在强化网络保障基础上，面向一线医务人员实施多项资费减免优惠并持续至疫情结束，以支持一线医务人员打赢疫情防控阻击战。<br style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\"></span></p><section style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\"></section><section style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\">　　<strong style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\">中国电信</strong>为赴湖北医疗人员6000多人提供在湖北期间通信费用直接减免服务，为医疗、防控指挥等重要人员电话提供特定免停机服务，惠及40余万人。各地分公司积极为防疫抗灾等特定群体提供通信费用减免服务，惠及4.1万人。</section><section style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\"></section><section style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\">　　<strong style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\">中国移动</strong>为赴湖北医疗人员提供话费减免服务，惠及2.8万人。同时，为赴湖北医疗人员及省内抗疫医务人员提供免停机服务，惠及80.8万人。</section><section style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\"></section><section style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\">　　<strong style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\">中国联通</strong>为赴湖北医疗人员中的联通用户赠送520元话费，并提供免停机服务。各地分公司积极为抗疫一线医务人员实施免停机服务，并给予话费减免，已惠及 6576名医务人员，其中支援湖北医务人员2796名。</section><section style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\"><br style=\"margin: 0px; padding: 0px; max-width: 100%; overflow-wrap: break-word !important;\"></section><section style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; line-height: 1.75em; overflow-wrap: break-word !important;\">　　下一步，三家基础电信企业将根据一线医护人员实际需求，继续实施更大力度的资费优惠政策与举措，以实际行动向抗疫一线广大医护人员致敬。</section>', '2020-02-27 15:35:38', 'admin', '0', '0', '120', 'admin,luyunyun', 'admin', '8EADB678-A646-1E51-3E87-75A547B8AF19');
