-- ----------------------------
-- Table structure for contract
-- ----------------------------
DROP TABLE IF EXISTS `contract`;
CREATE TABLE `contract` (
  `ID` bigint NOT NULL AUTO_INCREMENT,
  `CONTRACT_ID` varchar(50) DEFAULT NULL COMMENT '合同id',
  `SORT_NO` int DEFAULT NULL COMMENT '排序',
  `CONTRACT_CODE` varchar(50) DEFAULT NULL COMMENT '合同编号',
  `SIGN_TIME` varchar(20) DEFAULT NULL COMMENT '签订时间',
  `SIGN_ADDRESS` varchar(255) DEFAULT NULL COMMENT '签订地址',
  `TITLE` varchar(255) DEFAULT NULL COMMENT '合同标题',
  `CONTRACT_TYPE` varchar(50) DEFAULT NULL COMMENT '合同类型',
  `PAY_TYPE` varchar(2) DEFAULT NULL COMMENT '结算方式(1.进度付款;2.滚动付款;3.款到发货;4.货到付款)',
  `CASH_TYPE` varchar(2) DEFAULT NULL COMMENT '结算币种(1.人民币;2.美元;3.其它)',
  `SORT_ID` varchar(50) DEFAULT NULL COMMENT '合同类型id',
  `START_TIME` varchar(20) DEFAULT NULL COMMENT '履行期限开始',
  `END_TIME` varchar(20) DEFAULT NULL COMMENT '履行期限终止',
  `CONTENT` text COMMENT '合同条款',
  `CUSTOMER_NAME` varchar(50) DEFAULT NULL COMMENT '需方id',
  `REGIST_ADDR` varchar(100) DEFAULT NULL COMMENT '需方地址',
  `LEGAL_PERSON` varchar(50) DEFAULT NULL COMMENT '需方法人',
  `CUSTOMER_SIGN_USER` varchar(50) DEFAULT NULL COMMENT '需方签订人',
  `MOBILE` varchar(20) DEFAULT NULL COMMENT '需方电话',
  `BANK` varchar(50) DEFAULT NULL COMMENT '需方开户行',
  `BANK_ACCOUNT` varchar(30) DEFAULT NULL COMMENT '需方账号',
  `TAX_NO` varchar(30) DEFAULT NULL COMMENT '需方税号',
  `MY_ORG_NAME` varchar(30) DEFAULT NULL COMMENT '供方名称',
  `MY_ORG_ADD` varchar(30) DEFAULT NULL COMMENT '供方地址',
  `MY_LEGAL_PERSON` varchar(50) DEFAULT NULL COMMENT '供方法人',
  `MY_SIGN_USER` varchar(50) DEFAULT NULL COMMENT '供方签订人',
  `MY_SIGN_MOBILE` varchar(20) DEFAULT NULL COMMENT '供方联系电话',
  `MY_BANK` varchar(50) DEFAULT NULL COMMENT '供方开户行',
  `MY_BANK_ACCOUNT` varchar(30) DEFAULT NULL COMMENT '供方账号',
  `MY_TAX_NO` varchar(30) DEFAULT NULL COMMENT '供方税号',
  `CREATE_TIME` varchar(20) DEFAULT NULL COMMENT '录入合同时间',
  `CREATE_USER` varchar(50) DEFAULT NULL COMMENT '录入合同人',
  `ATTACH` text COMMENT '附件',
  `TOTAL` decimal(10,2) DEFAULT '0.00',
  `REAL_TOTAL` decimal(10,2) DEFAULT '0.00',
  `REMARK` text,
  `ORG_ID` varchar(50) DEFAULT NULL COMMENT '机构id',
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

