  `ATTACH_PRIV` varchar(2) DEFAULT NULL COMMENT '附件权限',
  `USER_PRIV` text COMMENT '经办人员',
  `DEPT_PRIV` text COMMENT '经办部门',
  `LEAVE_PRIV` text COMMENT '经办行政级别',
  `WRITER_FIELD` text COMMENT '可写字段',
  `CHILD_TABLE_PRIV` text COMMENT '子表权限',
  `CHILD_TABLE_ROW_PRIV` text,
  `CONCURRENT_FLAG` varchar(2) DEFAULT '0' COMMENT '并发标记',
  `GATHER_FLAG` varchar(2) DEFAULT '0' COMMENT '0:强制合并，1非强制合并',
  `PASS_END_FLAG` varchar(2) DEFAULT '0' COMMENT '中途是否可以按客观意见结束流程',
  `PRCS_CONDITION` text COMMENT '转交条件',
  `AUTO_USER_MODEL` text COMMENT '自动选人方式',
  `S_PRCS_AUTO` varchar(50) DEFAULT NULL COMMENT '自动选人规则',
  `S_PRCS_AUTO_OTHER` text,
  `CHILD_FLOW` varchar(50) DEFAULT NULL COMMENT '关联的子流程ID',
  `WAIT_PRCS_ID` text COMMENT '等待的步骤(多个)',
  `PARENT_WAIT` varchar(2) DEFAULT NULL COMMENT '是否等待0:不等待,1:等待指定步骤完成2:全部步骤完成',
  `PUBLIC_FILE` varchar(100) DEFAULT NULL COMMENT '公共附件权限',
  `GO_BACK` varchar(2) DEFAULT '0' COMMENT '是否可以回退',
  `FOLLOW` varchar(2) DEFAULT '0' COMMENT '是否可以关注',
  `PASS_TIME` decimal(5,2) DEFAULT '0.00' COMMENT '办理时限',
  `MUST_FIELD` varchar(2000) DEFAULT NULL COMMENT '必填字段',
  `HIDE_FIELD` varchar(2000) DEFAULT NULL COMMENT '隐藏字段',
  `NUM_FIELD` varchar(2000) DEFAULT NULL COMMENT '数字字段校验',
  `SMS_CONFIG` varchar(200) DEFAULT NULL COMMENT '步骤转交时的提醒方式',
  `IDEA_YES_OR_NO` varchar(2) DEFAULT '1' COMMENT '客观意见',
  `BEFORE_CLASS` varchar(200) DEFAULT NULL COMMENT '步骤执行前的插件类',
  `BEFORE_PARAM` varchar(500) DEFAULT NULL COMMENT 'BPM插件参数',
  `AFTER_CLASS` varchar(200) DEFAULT NULL COMMENT '步骤执行完成后的插件类名',
  `AFTER_PARAM` varchar(500) DEFAULT NULL COMMENT 'BPM插件参数',
  `OP_RULE` varchar(2) DEFAULT '0' COMMENT '0,明确主办人1，先接收为主办，2后接收为主办',
  `CHANGE_TITLE` varchar(1) DEFAULT '0' COMMENT '是不是可以修改BPM标题',
  `AUTO_SEND_TYPE` varchar(1) DEFAULT '0' COMMENT '步骤结束后提醒方式',
  `AUTO_SEND_USER` varchar(255) DEFAULT NULL COMMENT '步骤结束提醒人员',
  `REMARK` text COMMENT '备注说明',
  `APPROVAL` varchar(2) DEFAULT '0' COMMENT '审批意见是否可以查看',
  `APPROVAL_FLAG` varchar(2) DEFAULT NULL COMMENT '1：可以会签 0：禁止会签2：强制会签',
  `USER_LEAVE_FLAG` varchar(2) DEFAULT '0' COMMENT '行政级别是不否开启',
  `REMIND_CREATE_USER` varchar(200) DEFAULT NULL COMMENT '提醒发起人权限',
  `REMIND_PARTICIPANT` varchar(200) DEFAULT NULL COMMENT '提醒流程参与权限',
  `REMIND_NEXT_USER` varchar(200) DEFAULT NULL COMMENT '提醒下一步流程办理人',
  `CREATE_USER` varchar(50) DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` varchar(20) DEFAULT NULL COMMENT '创建时间',
  `ORG_ID` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`ID`) USING BTREE,
  KEY `ID` (`ID`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8;

