-- ----------------------------
-- Function structure for FUN_INTE_ARRAY
-- ----------------------------
DROP FUNCTION IF EXISTS `FUN_INTE_ARRAY`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `FUN_INTE_ARRAY`(`setA` text,`setB` text) RETURNS int
    DETERMINISTIC
BEGIN  
    DECLARE idx INT DEFAULT 0 ; -- B 集合单元索引   
    DECLARE len INT DEFAULT 0;-- B 集合表达式长度  
    DECLARE llen INT DEFAULT 0;-- 最后检查位置  
    DECLARE clen INT DEFAULT 0;-- 当前检查位置  
    DECLARE tmpStr TEXT;-- 临时检查数据集  
    DECLARE curt TEXT;-- B 当前检查的单元  
    SET len = LENGTH(setB);  
    WHILE idx < len DO  
        SET idx = idx + 1;  
        SET tmpStr = SUBSTRING_INDEX(setB,",",idx);  
        SET clen = LENGTH(tmpStr);  
-- 获取当前 setB 中的单元  
        IF idx = 1 THEN SET curt = tmpStr;  
        ELSE SET curt = SUBSTRING(setB,llen+2,clen-llen-1);  
        END IF;  
--  判断是分隔的B集合中是否有空字符串 
				IF LENGTH(curt)=0 THEN RETURN 0; 
				END IF;
-- 检查是否存在于 setA 中 
        IF FIND_IN_SET(curt,setA) > 0 THEN RETURN 1;  
        END IF;  
-- 当前检查终点与上次检查终点相同则跳出  
        IF clen <= llen THEN RETURN 0;  
        END IF;  

        SET llen = clen;  
    END WHILE;  
    RETURN 0;  
END
;;
DELIMITER ;
